        <div className="row">
          <div className="col my-4">
            <NewsItem
              title="myTitle"
              description="myDescription"
              imgUrl="https://s.yimg.com/os/creatr-uploaded-images/2021-05/a8217250-bdfa-11eb-bfc4-2663225cea83"
            />
          </div>
          <div className="col my-4">
            <NewsItem title="myTitle" description="myDescription" />
          </div>
          <div className="col my-4">
            <NewsItem title="myTitle" description="myDescription" />
          </div>
        </div>
      </div>
    );
  }
}

export default News;
